CREATE TABLE Seasons (
    Title_ID INT,
    Season_number INT,
    Number_of_Episodes INT CHECK (Number_of_Episodes >= 0),
    Current_Status VARCHAR(20) CHECK (Current_Status IN ('Completed', 'Ongoing', 'Cancelled')),
    PRIMARY KEY (Title_ID, Season_number),
    FOREIGN KEY (Title_ID) REFERENCES TVShows(Title_ID)
);

